import React, { useState } from 'react';
import styles from './styles/dashboa.module.css';
const Dashboard = () => {
  const [email, setEmail] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!email) return;
    
    setIsLoading(true);
    
    // Simulate API call delay
    setTimeout(() => {
      // Store email and redirect to actual dashboard
      localStorage.setItem('email', email);
      // You can redirect to your actual dashboard here
      // window.location.href = '/actual-dashboard';
      setIsLoading(false);
      alert('OTP sent! (This is a demo)');
    }, 1000);
  };

  return (
    <div className={styles.container}>
      <div className={styles.card}>
        <h1 className={styles.title}>Welcome to Incognito Inbox</h1>
        <p className={styles.subtitle}>Enter your email to continue</p>
        
        <form onSubmit={handleSubmit} className={styles.form}>
          <div className={styles.inputGroup}>
            <label htmlFor="email" className={styles.label}>
              Email Address
            </label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter your email"
              className={styles.input}
              required
            />
          </div>
          
          <button 
            type="submit" 
            className={styles.button}
            disabled={isLoading}
          >
            {isLoading ? 'Sending...' : 'Send OTP'}
          </button>
        </form>
        
        <div className={styles.footer}>
          <span className={styles.footerText}>Powered by </span>
          <a href="#" className={styles.footerLink}>Incognito Inbox</a>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
